function Sandbox () {}

Sandbox.prototype.injectHTML = function (str) {
    document.getElementsByTagName('body')[0].innerHTML += str;
};

Sandbox.prototype.injectCSS = function (str) {
    var node = document.createElement('style');
    node.innerHTML = str;
    document.body.appendChild(node);
};

Sandbox.prototype.injectJS = function (str) {
    var processed = str;
    return eval.call(window, processed);
};

function Console () {
    var self = this;
    
    var logFunc = window.console.log;
    console.log = function (...args) {
        logFunc(...args);
        for(var i in args) {
            var t = self.textColor(args[i]);
            self.postConsoleText(t.text, t.type);
        }
    };

    var errorFunc = window.console.error;
    console.error = function (...arg) {
        errorFunc(...arg);
        self.postConsoleText(arg[0], 'error');
    };

    // window.onerror �𦻖�𤣰�嘑銵� setInterval �𤩎��毺��𥲤隤�
    window.onerror = function(message, source, lineno, colno, error) {
        var text = 'Line: ' +lineno + ':' + colno + ' ' + message;
        self.postConsoleText(text, 'error');
    };
}

Console.prototype.postConsoleText = function (text, type, icon) {
    parent.postMessage({
        text: text,
        type: type,
        icon: icon,
        fn: 'console'
    },'*');
};

Console.prototype.textColor = function (data) {
        
    var type = typeof data;

    if(data === null) return {text: 'null', type: 'null'};

    if(type === 'object') return {text: CircularJSON.stringify(data,null,4), type: 'object'};

    if(data === undefined) return {text: 'undefined', type: 'undefined'};

    return {text: data.toString(), type: type};
};

window.missionComplete = function () {
    parent.postMessage({
        fn: 'missionComplete'
    },'*');
};
