// Global Configs







(function () {

    var sandbox = new Sandbox();

    var console = new Console();

    window.addEventListener('message', function(event) {
        var origin = event.origin || event.originalEvent.origin; // For Chrome, the origin property is in the event.originalEvent object.
        if (!CORS_DOMAINS.includes(origin)) {
            return;
        }

        var data = event.data;
        if(data.fn === 'injectHTML') {
            sandbox.injectHTML(data.params);
        }
        if(data.fn === 'injectCSS') {
            sandbox.injectCSS(data.params);
        }
        if(data.fn === 'injectJS') {
            sandbox.injectJS(data.params);
        }
        if(data.fn === 'injectCode') {
            var res = sandbox.injectJS(data.params);
            var text = console.textColor(res);
            if(text.type === 'string') {
                text.data = '"' + text.data + '"';
            }
            console.postConsoleText(text.text, text.type, '<');
        }
        if(data.fn === 'screenshot') {
            screenShot(function(data) {
                var result = {
                    fn: 'screenshot',
                    content: data
                }
                event.source.postMessage(result, origin);
            });
        }
        if(data.fn === 'focusStage') {
            window.focus();
        }
    });
})();


function screenShot (callback) {

    var body = document.body;

    html2canvas(body).then(function(canvas) {
        callback(canvas.toDataURL('image/jpeg'));
    });
}
